@title Vault
@author YieldFi Team
@notice ERC20Upgradeable token contract representing vault shares
@dev ERC20 token with custom name/symbol functionality and share locking
@dev Features:
     - Custom name and symbol support (overrides ERC20 metadata)
     - Share locking: Tracks locked shares per user (for redemption queue)
     - Manager integration: References Manager contract for NAV and Registry access
     - Pure token contract: NAV logic moved to separate NAV contract
